# 给定一个由 0 和 1 组成的矩阵 mat ，请输出一个大小相同的矩阵，其中每一个格子是 mat 中对应位置元素到最近的 0 的距离。
# 
# 两个相邻元素间的距离为 1 。
# 
# 来源：力扣（LeetCode）
# 链接：https://leetcode-cn.com/problems/01-matrix
# 著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
class Solution:
    def updateMatrix(self, mat):
        row = len(mat)
        col = len(mat[0])
        visited = []
        queue = []
        for i in range(row):
            for j in range(col):
                if mat[i][j] == 0:
                    visited.append((i, j))
                    queue.append((i, j))
        while queue != []:
            pix = queue[0]
            r, c = pix
            queue.remove(pix)
            result = mat[r][c] + 1
            if r + 1 < row and (r + 1, c) not in visited:
                queue.append((r + 1, c))
                visited.append((r + 1, c))
                mat[r + 1][c] = result
            if r - 1 >= 0 and (r - 1, c) not in visited:
                queue.append((r - 1, c))
                visited.append((r - 1, c))
                mat[r - 1][c] = result
            if c + 1 < col and (r,  c + 1) not in visited:
                queue.append((r, c + 1))
                visited.append((r, c + 1))
                mat[r][c + 1] = result
            if c - 1 >= 0 and (r,  c - 1) not in visited:
                queue.append((r, c - 1))
                visited.append((r, c - 1))
                mat[r][c - 1] = result
        return mat
    # 此法快得多    
    def updateMatrix(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: List[List[int]]
        """
        m, n = len(matrix), len(matrix[0])
        Q = collections.deque([])
        visited = set()
        # 初始化队列，将所有起始点加入
        for i in range(m):
            for j in range(n):
                if matrix[i][j] == 0:
                    Q.append((i, j))
                    visited.add((i, j))
        # 将所有相邻节点加入队列
        while Q:
            i, j = Q.popleft()
            for x, y in [(i+1, j), (i-1, j), (i, j+1), (i, j-1)]:
                if 0 <= x < m and 0 <= y < n and (x, y) not in visited:
                    matrix[x][y] = matrix[i][j] + 1
                    visited.add((x, y))
                    Q.append((x, y))
        return matrix

